<section>
    <div class="container">
        <div class="row">
            <div class="col-12">
                <h2 class="mb-4">How to find a great car rental deal</h2>
                <p>We’ll take care of finding the lowest price for you, but here’s what you can do to make sure you get the best deal:</p>
            </div>
        </div>
        <div class="row">
            <div class="col-3">
                <div class="how-to-container">
                    <div class="how-to-block book-early"></div>
                    <h4>Book Early</h4>
                    <p>Prices generally rise when it gets closer to the starting date of your trip. Book ahead to save and don’t worry, you can always make changes or cancel for free if your plans change.</p>
                </div>
            </div>
            <div class="col-3">
                <div class="how-to-container">
                    <div class="how-to-block pay-attention-to-reviews"></div>
                    <h4>Pay Attention To Reviews</h4>
                    <p>See what previous customers have to say about the rental company. Choosing a company with a score of 8 or higher is recommended.</p>
                </div>
            </div>
            <div class="col-3">
                <div class="how-to-container">
                    <div class="how-to-block keep-deposit-in-mind"></div>
                    <h4>Keep the Deposit in Mind</h4>
                    <p>You will have to leave a deposit when you pick up the car. In the rental conditions, you can see how much it will be. Make sure you have enough credit available to cover it.</p>
                </div>
            </div>
            <div class="col-3">
                <div class="how-to-container">
                    <div class="how-to-block fuel-and-mileage"></div>
                    <h4>Know the Fuel and Mileage Policies</h4>
                    <p>Avoid costly fees by knowing how much mileage is included in your rental and what the fuel policy is.</p>
                </div>
            </div>
        </div>
    </div>
</section>
